import React from 'react';
import Nav from './Navigation';
import { prependOnceListener } from 'cluster';

const MainPage = (props) => {
    return(
        <div>
            <Nav getSubreddit = {props.getSubreddit}/>
            <p>Home Page</p>
        </div>
    );
};

export default MainPage;
